function Inline() {
    const heading = {
        fontSize: '72px',
        color: 'blue'
    }

  return (
    <div>
        <h1 style={heading} className='error'>Inline</h1>
      {/* <h1 style={{fontSize: '72px'}}>Inline</h1> */}
    </div>
  )
}

export default Inline
